        "title": "STAR WARS IMPRESSIONS! (Vader, Solo, Finn, Kylo Ren)",
        "description": "I feel like there are a lot of Star Wars impression videosbut I still wanted to try. :-P\n-- 23 MORE IMPRESSIONS HERE: https://www.youtube.com/watch?v=8ZHDd6RhMO4\n-- MORE OF MY MUSIC HERE: https://www.youtube.com/watch?v=2VldrGG0D9s&list=PLv1P-6YxEm6AgF6yiKtydFevNQV4RxKn4\n-- MY ALBUMS AVAILABLE HERE: https://blackgryph0n.bandcamp.com/album/immortal\n-- MORE OF THE STUFF I'M IN: https://www.youtube.com/watch?v=CZlfbep2LdU&list=PLv1P-6YxEm6BwWvcg3HF6oN7K_LcrMsOx\n\n-- THE MIC I USE: https://www.amazon.com/gp/product/B0145OGS7U/ref=as_li_tl?ie=UTF8&camp=1789&creative=9325&creativeASIN=B0145OGS7U&linkCode=as2&tag=blackgryph0n-20&linkId=018ddfb82db517b338d0fecf3a002cff\n\nThis took longer than it should have... I think I got a little carried away with the characters and ended up doing a lot more than I had originally planned. Hope it doesn't drag on. I'm always worried about my videos being boring. Stupid is fine, cringy is finebut boring? Unacceptable!\n\nAnd now... the links and the credits! *does anybody read this?*\n\nBG Music Used: https://www.youtube.com/watch?v=Xzg8guhOYTk\n\nPLEASE SUBSCRIBE! https://www.youtube.com/c/BlackGryph0n\n\nYou can also follow me on:\nTwitter: https://twitter.com/BlackGryph0n\n\nInstigram: https://www.instagram.com/blackgryph0n/\n\nSnapchat: https://pbs.twimg.com/media/Cemv1ymXEAAC8Mi.jpg\n\nWebsite: https://gabrielcbrown.com/\n\n\nBuisnes Inquires: GabrielBrownInfo@gmail.com\n\n\n\n- -- --- ---- Impressions ---- --- -- -\n\n\nWatto - Andy Secombe\nC-3PO - Anthony Daniels\nYoda - Frank Oz\nDarth Vader - James Earl Jones\nAdmiral Ackbar - Erik Bauersfeld\nJar Jar Binks - Ahmed Best\nBoss Rugor Nass - Brian Blessed\nMace Windu - Samuel L. Jackson\nRune Haako - Jerome Blake\nNute Gunray - Silas Carson\nCount Dooku - Christopher Lee\nSebulba - Lewis MacLeod\nYoung Anakin - Jake Lloyd\nYoung Obi-Wan Kenobi - Ewan McGregor\nQui-Gon Jinn - Liam Neeson\nOld Obi-Wan Kenobi - Sir Alec Guinness\nLando Calrissian - Billy Dee Williams\nHan Solo - Harrison Ford\nLuke Skywalker - Mark Hamill\nDarth Sidious (Sheev Palpatine) - Ian McDiarmid\nLightsaber\nTie Fighter\nFinn (FN-2187) - John Boyega\nSupreme Leader Snoke - Andy Serkis\nKylo Ren (Ben Solo) - Adam Driver\nTeen Anakin - Hayden Christensen\nChewbacca - Bears and stuff\nJabba the Hutt - Larry Ward\n\n\n- -- --- ---- END ---- --- -- -\n\n\nHELLO! DDRs (Dedicated Description Readers)!! Well, I'm up super late again! I'm always like two hours behind schedule with these thingsbut I'm never upset cause I'm usually just relieved that it's done. :-P\n\nIn case you were wondering, our families Lake Powell trip was AMAZING!! Way cooler than I expected and I was expecting a lot! The houseboat was wonderful, the scenery was amazing, and the water was (almost) perfect! (a bit on the cold side).\n\nNate and I jumped from as many cliffs as we could find. Gradually getting higher and higher until it started hurting... Then we dialed it back a bit. ^^; Here's one of the higher ones we jumped from: https://scontent-lax3-1.xx.fbcdn.net/v/t1.0-9/35081027_10211609765667293_1730236513020542976_n.jpg?_nc_cat=0&_nc_eui2=AeEnTND3ntxMYEn_KZvphGv8Ce-roYaUo_0nlbQ4yG0ugMDI_EKcFCs6LCNi883zMquzx8BhvbRYCRW6DxfnazwdpMVgOs2IaucE8zQMgZbq-A&oh=c92bcf7588752645447f799f601b4faf&oe=5BACB743\n\nOH! We also rented a Jetski and bought a tube. For those of you who don't know, Nate drives Jetski's as part of his job in the Navy, so he was very good at making it almost impossible to hold on. XP\nHere's a video of him (successfully) throwing me off the tube on the last day of our trip: https://youtu.be/sqfewvRFfEg\n\nI'll post some more pictures laterbut I'm heading to Hawaii in a few days, then to South Dakota right after that (talk about transplant shock!) then finally to Baltimore for BronyCon! WOO!\n\nHow was your summer so far? Do anything fun? Anything planned for the 4th of July? (or any non-American summer holiday. :-P)\n\nTalk soon!\n\n~Gabe",
